import './App.css';
import {BrowserRouter, Routes, Route} from "react-router-dom"
import { ChakraProvider} from "@chakra-ui/react"
import Home from './pages/Home.page';

function App() {
  return (
    <ChakraProvider>
    <BrowserRouter>
     <Routes>
       <Route path='/'/>
       <Route />
       <Route />
       <Route />
     </Routes>
    </BrowserRouter>
  </ChakraProvider>
  );
}

export default App;
